// src/components/GalleryMosaic/GalleryMosaic.tsx
import React, { useMemo } from 'react';
import './GalleryMosaic.css';
import { galleryExtended } from './gallery';

const GalleryMosaic: React.FC = () => {
  const items = useMemo(() => galleryExtended.slice(0, 20), []);

  return (
    <section className="gallery" id="gallery" aria-labelledby="gallery-title">
      <h2 id="gallery-title" className="gallery__title">Galerie lucrÄƒri</h2>
      <div className="mosaic">
        {items.map((it, i) => (
          <figure key={i} className="tile">
            <img src={it.src} alt={it.alt} loading="lazy" />
            {it.caption && <figcaption>{it.caption}</figcaption>}
          </figure>
        ))}
      </div>
    </section>
  );
};

export default GalleryMosaic;
